{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/lddalrymple/penguins-prototype-r-eda?scriptVersionId=121365859\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"320b252d","metadata":{"papermill":{"duration":0.009965,"end_time":"2023-03-07T18:04:46.274574","exception":false,"start_time":"2023-03-07T18:04:46.264609","status":"completed"},"tags":[]},"source":["# Background and Citation Information on Palmer Penguins' Dataset: \n","### About Dataset: \n","\n","Please refer to the official Github page (https://github.com/allisonhorst/palmerpenguins/blob/main/README.md) for details and license information. The details below have also been taken from there.\n","\n","Artwork: @allison_horst\n","Palmer Archipelago (Antarctica) penguin data\n","\n","Data were collected and made available by Dr. Kristen Gorman and the Palmer Station, Antarctica LTER, a member of the Long Term Ecological Research Network.\n","\n","Thank you to Dr. Gorman, Palmer Station LTER and the LTER Network! Special thanks to Marty Downs (Director, LTER Network Office) for help regarding the data license & use.\n","License & citation\n","\n","    Data are available by CC-0 license in accordance with the Palmer Station LTER Data Policy and the LTER Data Access Policy for Type I data.\n","\n","    Please cite this data using: Gorman KB, Williams TD, Fraser WR (2014) Ecological Sexual Dimorphism and Environmental Variability within a Community of Antarctic Penguins (Genus Pygoscelis). PLoS ONE 9(3): e90081. doi:10.1371/journal.pone.0090081\n","\n","### Data:\n","\n","These data are originally published in:\n","\n","Gorman KB, Williams TD, Fraser WR (2014) Ecological Sexual Dimorphism and Environmental Variability within a Community of Antarctic Penguins (Genus Pygoscelis). PLoS ONE 9(3): e90081. doi:10.1371/journal.pone.0090081\n","\n","Anyone interested in publishing the data should contact Dr. Kristen Gorman about analysis and working together on any final products.\n","\n","From Gorman et al. (2014): \"Data reported here are publicly available within the PAL-LTER data system (datasets #219, 220, and 221): http://oceaninformatics.ucsd.edu/datazoo/data/pallter/datasets. These data are additionally archived within the United States (US) LTER Network‚Äôs Information System Data Portal: https://portal.lternet.edu/. Individuals interested in using these data are therefore expected to follow the US LTER Network‚Äôs Data Access Policy, Requirements and Use Agreement: https://lternet.edu/data-access-policy/.\"\n","\n","From the LTER data access policy: \"The consumer of these data (‚ÄúData User‚Äù herein) has an ethical obligation to cite it appropriately in any publication that results from its use. The Data User should realize that these data may be actively used by others for ongoing research and that coordination may be necessary to prevent duplicate publication. The Data User is urged to contact the authors of these data if any questions about methodology or results occur. Where appropriate, the Data User is encouraged to consider collaboration or coauthorship with the authors. The Data User should realize that misinterpretation of data may occur if used out of context of the original study. While substantial efforts are made to ensure the accuracy of data and associated documentation, complete accuracy of data sets cannot be guaranteed. All data are made available ‚Äúas is.‚Äù The Data User should be aware, however, that data are updated periodically and it is the responsibility of the Data User to check for new versions of the data. The data authors and the repository where these data were obtained shall not be liable for damages resulting from any use or misinterpretation of the data. Thank you.\"\n","Links to original data & metadata:\n","\n","### Original data accessed via the Environmental Data Initiative:\n","\n","Ad√©lie penguins: Palmer Station Antarctica LTER and K. Gorman. 2020. Structural size measurements and isotopic signatures of foraging among adult male and female Ad√©lie penguins (Pygoscelis adeliae) nesting along the Palmer Archipelago near Palmer Station, 2007-2009 ver 5. Environmental Data Initiative. https://doi.org/10.6073/pasta/98b16d7d563f265cb52372c8ca99e60f (Accessed 2020-06-08).\n","\n","Gentoo penguins: Palmer Station Antarctica LTER and K. Gorman. 2020. Structural size measurements and isotopic signatures of foraging among adult male and female Gentoo penguin (Pygoscelis papua) nesting along the Palmer Archipelago near Palmer Station, 2007-2009 ver 5. Environmental Data Initiative. https://doi.org/10.6073/pasta/7fca67fb28d56ee2ffa3d9370ebda689 (Accessed 2020-06-08).\n","\n","Chinstrap penguins: Palmer Station Antarctica LTER and K. Gorman. 2020. Structural size measurements and isotopic signatures of foraging among adult male and female Chinstrap penguin (Pygoscelis antarcticus) nesting along the Palmer Archipelago near Palmer Station, 2007-2009 ver 6. Environmental Data Initiative. https://doi.org/10.6073/pasta/c14dfcfada8ea13a17536e73eb6fbe9e (Accessed 2020-06-08)."]},{"cell_type":"markdown","id":"626e4ef3","metadata":{"papermill":{"duration":0.00858,"end_time":"2023-03-07T18:04:46.29118","exception":false,"start_time":"2023-03-07T18:04:46.2826","status":"completed"},"tags":[]},"source":["### For RStudio YAML Style Header\n","#### Title: Penguins Prototype - R EDA\n","#### Author: L.D. Dalrymple\n","#### Date: October 27, 2022\n","#### Version: 1.0.5"]},{"cell_type":"markdown","id":"48be6ec7","metadata":{"papermill":{"duration":0.00819,"end_time":"2023-03-07T18:04:46.307115","exception":false,"start_time":"2023-03-07T18:04:46.298925","status":"completed"},"tags":[]},"source":["# Case Study and EDA Set-Up: \n","\n","## Introduction: \n","\n","Often, the Palmer Penguin's dataset is used to practice working with ggplot2 as an Iris alternative, and while I also intend to do that here, I thought I would add the constraint of formating my Exploratory Data Analysis (EDA) as a case study for additional analytical practice. \n","\n","This self-created prompt will work with the penguins' data under the simulation of being an analyst setting up a prototype outline for an informational demonstration of the penguins' on account of a fictional \"Fictional Conservation Initiative\".\n","\n","The following goals and objectives however are inspired by and sampled from the *real* mission statement of the Palmer Station Antarctica LTER found here: https://pallter.marine.rutgers.edu/education-outreach/. \n","\n","## üêß Mission Statement: \n","\n","* Inspire education and outreach, focused on increasing the publics‚Äô knowledge and excitement for science conducted along the western Antarctic peninsula\n","* Support the next generation through an engaging and innovative field and classroom experience for K-12 students\n","* Provide opportunities to pursue lifelong learning through public outreach initiatives\n","\n","## üêß Case Study Goals: \n","\n","The Case Study Goals of this Exploratory Data Analysis (EDA) of the Palmer Penguins Data would then be: \n","\n","* Curate a selection of data of interest to the general public to inspire interaction with the natural sciences \n","\n","AND / OR \n","\n","* Curate a selection of data that would be engaging to the target demographic of students in the K-12 age ranges for educational instruction \n","\n","## What is good to know about penguins?\n","\n","Sample questions I hope to work on with this EDA to format a prototype presentation about penguins for the \"Fictional Conservation Initiative\" are as follows: \n","\n","* Where do penguins like to live north of the Antarctic Circle? (where Palmer Sation is)\n","* Do penguins live near each other, or far away? Does there seem to be a reason why this might be? \n","* Do the penguins have distinct characteristics? Or are they mostly similar?\n","* Does the data reveal anything unusual that might be worth expanding on in the presentation?\n","\n","And of course: \n","\n","* Do the results of the analysis reveal any insights about penguins that could be engaging to a wide variety of age groups so that the \"Fictional Conservation Initiative\" can meet their educational goals? \n","\n","Oh boy, I hope! That could be a factor in future research funding! \n","\n","So, with that said, let's go meet the penguins! üêßüêßüêß"]},{"cell_type":"markdown","id":"3acb3798","metadata":{"papermill":{"duration":0.008164,"end_time":"2023-03-07T18:04:46.323761","exception":false,"start_time":"2023-03-07T18:04:46.315597","status":"completed"},"tags":[]},"source":["# Summary Analysis:"]},{"cell_type":"code","execution_count":1,"id":"03f49f07","metadata":{"execution":{"iopub.execute_input":"2023-03-07T18:04:46.344169Z","iopub.status.busy":"2023-03-07T18:04:46.34186Z","iopub.status.idle":"2023-03-07T18:04:48.284986Z","shell.execute_reply":"2023-03-07T18:04:48.282985Z"},"papermill":{"duration":1.957493,"end_time":"2023-03-07T18:04:48.289033","exception":false,"start_time":"2023-03-07T18:04:46.33154","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["‚îÄ‚îÄ \u001b[1mAttaching packages\u001b[22m ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ‚îÄ tidyverse 1.3.2 ‚îÄ‚îÄ\n","\u001b[32m‚úî\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6      \u001b[32m‚úî\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.5 \n","\u001b[32m‚úî\u001b[39m \u001b[34mtibble \u001b[39m 3.1.8      \u001b[32m‚úî\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.10\n","\u001b[32m‚úî\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.1      \u001b[32m‚úî\u001b[39m \u001b[34mstringr\u001b[39m 1.4.1 \n","\u001b[32m‚úî\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.3      \u001b[32m‚úî\u001b[39m \u001b[34mforcats\u001b[39m 0.5.2