:"2023-03-07T18:04:53.994507","exception":false,"start_time":"2023-03-07T18:04:53.973044","status":"completed"},"tags":[]},"source":["Now that we have some fun data about the sizes of penguins and where they live, the next step I'd like to take is to make a set of dashboards, or collections of the visualized data, so the penguins are easy to learn about and the data is easy to share. \n","\n","As a quick reference, here are all the variable names the previous charts were saved to: \n","\n","1. penguinperisland \n","2. hbarpenguins\n","3. penguinshisto\n","4. sizeperpenguin\n","5. speciesperisland\n","\n","If you'd like to try patchwork, remember to save your graphs and charts as new variables!"]},{"cell_type":"code","execution_count":15,"id":"672df414","metadata":{"execution":{"iopub.execute_input":"2023-03-07T18:04:54.052709Z","iopub.status.busy":"2023-03-07T18:04:54.040144Z","iopub.status.idle":"2023-03-07T18:04:54.128687Z","shell.execute_reply":"2023-03-07T18:04:54.126522Z"},"papermill":{"duration":0.115964,"end_time":"2023-03-07T18:04:54.13163","exception":false,"start_time":"2023-03-07T18:04:54.015666","status":"completed"},"tags":[]},"outputs":[],"source":["# doing this will require another library to be loaded, so the charts can be grouped\n","# here, we'll use patchwork, it is easy to use, and allows graphics to be combined\n","\n","library(patchwork)"]},{"cell_type":"code","execution_count":16,"id":"f24183f5","metadata":{"execution":{"iopub.execute_input":"2023-03-07T18:04:54.176615Z","iopub.status.busy":"2023-03-07T18:04:54.174874Z","iopub.status.idle":"2023-03-07T18:04:54.96301Z","shell.execute_reply":"2023-03-07T18:04:54.959788Z"},"papermill":{"duration":0.815174,"end_time":"2023-03-07T18:04:54.966921","exception":false,"start_time":"2023-03-07T18:04:54.151747","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAPACAIAAAC9963GAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wU1RrH8WdrNptGqKH33nsA6SCggNgA6YIgCIgFvOBV