03-07T18:04:59.346717Z"},"papermill":{"duration":2.877533,"end_time":"2023-03-07T18:04:59.351272","exception":false,"start_time":"2023-03-07T18:04:56.473739","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Saving 12.5 x 6.67 in image\n","\n","Saving 12.5 x 6.67 in image\n","\n","`geom_smooth()` using method = 'loess' and formula 'y ~ x'\n","\n","`stat_bin()` using `bins = 30`. Pick better value with `binwidth`.\n","\n"]}],"source":["# this will help save the above dashboard as one .png file to make it easy to email out\n","# to anyone who might miss the prototype presentation or otherwise might need a copy to referance \n","\n","ggsave(\"penguindashislands.png\",\n","      penguindashislands)\n","\n","ggsave(\"penguinbodymassandflippers.png\",\n","      penguinbodymassandflippers)"]},{"cell_type":"markdown","id":"6c15db44","metadata":{"papermill":{"duration":0.02816,"end_time":"2023-03-07T18:04:59.406684","exception":false,"start_time":"2023-03-07T18:04:59.378524","status":"completed"},"tags":[]},"source":["Perfect! Now we have all the graphs collected and ready to go if needed for a prototype presentation!"]},{"cell_type":"markdown","id":"63187c39","metadata":{"papermill":{"duration":0.027642,"end_time":"2023-03-07T18:04:59.46272","exception":false,"start_time":"2023-03-07T18:04:59.435078","status":"completed"},"tags":[]},"source":["# Findings and Final Summary: \n","\n","## What We Learned About Penguins:\n","\n","We learned a lot about our 344 aquatic flightless friends! But in general, we observed: \n","\n","* Ad√©lie penguins like to live everywhere, Gentoos only like Biscoe, and Chinstraps live on Dream \n","\n","This answers: Where do penguins like to live north of the Antarctic Circle? (where Palmer Sation is) as well as part of the next question: **Do penguins live near each other, or far away? Does there seem to be a reason why this might be?**\n","\n","Unfortunately, without further resources, we might not be able to find out why that might be from this dataset, but we can let our friends at \"Fictional Conservation Initiative\" know!\n","\n","* the largest penguin by body mass was a biologically male-tagged Gentoo penguin from Biscoe island weighing 6300 grams, and the smallest penguin by body mass was a biologically female-tagged Chinstrap penguin from Dream island.\n","\n","These insights help us with the question of: **Do the penguins have distinct characteristics? Or are they mostly similar?**\n","\n","The penguins seem to be similar within their own species, but not necessarily similar across species. \n","\n","* But we also discovered that while most large penguins live on Biscoe island, and most small penguins live on Torgersen, the smallest penguin lives on Dream and could actually be a statistical outlier\n","\n","And this observation gives us a place to start with the question: **Does the data reveal anything unusual that might be worth expanding on in the presentation?**\n","\n","## üêß But, Did We Answer All the Questions?:\n","\n","What about the big one: **Do the results of the analysis reveal any insights about penguins that could be engaging to a wide variety of age groups so that the \"Fictional Conservation Initiative\" can meet their educational goals?**\n","\n","Well, we made it this far! That's a lot of engagement with penguin data, and pretty educational too. I'd say that's a pretty good start all things considered. :) \n","\n","## Buisness Suggestions from Protoype:\n","\n","The original initiatives of the EDA were as follows: \n","\n","* Curate a selection of data of interest to the general public to inspire interaction with the natural sciences \n","\n","AND / OR \n","\n","* Curate a selection of data that would be engaging to the target demographic of students in the K-12 age ranges for educational instruction \n","\n","Therefore my suggestions for the initial educational prototype would be to use the **penguindashislands** graphs about which penguins live where for younger children, as location and amount (\"how many?\") are concepts that could be more accessible to younger children because they do not contain as many numbers.\n","\n","Then, I would suggest using the second chart collection of **penguinbodymassandflippers** for older children, as these charts and graphs do contain more numeric-related information, as well as concepts like grams and millimeters that younger children might not have encountered yet.  \n","\n","Additionally, since there is limited ID information on specific penguins to build an educational story around, I would also suggest collaboration with additional \"Fictional Conservation Initiative\" experts about preferred penguin habitats, diets, or other environmental factors to build out the story of the penguins to create a holistic narrative of their place in the Antarctic. "]},{"cell_type":"markdown","id":"92f9c8d7","metadata":{"papermill":{"duration":0.027293,"end_time":"2023-03-07T18:04:59.517048","exception":false,"start_time":"2023-03-07T18:04:59.489755","status":"completed"},"tags":[]},"source":[" ## Potential Data Limitations: \n","\n","Data limitations are constraints about the data itself that potentially limit the scope of analysis, some of the limitations within the penguins' dataset could be: \n","\n","* there are uneven amounts of all the penguins, Chinstrap specifically that might skew results \n","* there might be a need for a second, larger estimation of penguin population sizes to see if these observations are statistically significate measures of these penguins populations"]},{"cell_type":"markdown","id":"dc3bb69c","metadata":{"papermill":{"duration":0.027181,"end_time":"2023-03-07T18:04:59.570765","exception":false,"start_time":"2023-03-07T18:04:59.543584","status":"completed"},"tags":[]},"source":["## Index Note: \n","\n","I adjusted the width of the charts by adding: \n","\n","*options(repr.plot.width =14, repr.plot.height =8)*\n","\n","The original charts that are generated are a much narrower width that might make the charts difficult to read when put into a patchwork dashboard or images for saving, but patchwork will still compile the charts if they're not adjusted. "]},{"cell_type":"markdown","id":"230b1990","metadata":{"papermill":{"duration":0.027438,"end_time":"2023-03-07T18:04:59.625223","exception":false,"start_time":"2023-03-07T18:04:59.597785","status":"completed"},"tags":[]},"source":["## Thank you so much for your time and your engagement with this rendition of the Palmer Penguins' Dataset! You've successfully helped the \"Fictional Conservation Initiative\" (and Palmer Station in real life too!) get closer to their goals of global polar education. \n","\n","\n","### Hope you enjoyed this peng-rrific exploratory data analysis exploration! \n","\n","#### Remember, data is people! (Or Penguins!) üêßüêßüêß"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":17.405632,"end_time":"2023-03-07T18:04:59.775234","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-03-07T18:04:42.369602","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}